import './TaskFilter.css';


const TaskFilter = ()=>{
    return(
<ul className="filters">
            <li>
              <button class="selected">All</button>
            </li>
            <li>
              <button>Active</button>
            </li>
            <li>
              <button className='clear-completed'>Completed</button>
            </li>
          </ul>
    )
}

export default TaskFilter;
